import * as RiIcons from 'react-icons/ri';

// Can use redux here
const SidebarData = [
  {
    title: 'Home',
    path: '/',
    icon: <AiIcons.AiFillHome />,
    className: 'data',
  },
  {
    title: 'Movies',
    path: '#',
    icon: <FaIcons.FaFilm />,
    iconClosed: <RiIcons.RiArrowDownSFill />,
    iconOpened: <RiIcons.RiArrowUpSFill />,
    subNav: [
      {
        title: 'Top',
        path: '/movies',
        // icon: <FaIcons.FaFilm />,
      },
      {
        title: 'Action',
