      // },
      // {
      //   title: 'Reality',
      //   path: '/tvshows/reality',
      // },
    ],
    className: 'data',
  },
  {
    title: 'Favorite',
    path: '/favorite',
    icon: <MdIcons.MdFavorite />,
    className: 'data',
  },
];

export default SidebarData;
